#include<stdio.h>
#include<string.h>
#include<iostream>
using namespace std;
const int M=10000;
int sgna,lena,A[50010];
int sgnb,lenb,B[50010];
void mul(int *a,int &len,int &sgn,int x){
	if(sgn==0)return;
	if(x<0)sgn=-sgn,x=-x;
	int j=0;
	for(int i=1;i<=len;i++){
		int jj=j;
		a[i]=a[i]*x+jj;
		j=a[i]/M;
		a[i]%=M;
	}
	while(j){
		len++;
		a[len]=j%M;
		j/=M;
	}
}
void inc(int *a,int &len,int &sgn){
	if(sgn==0){
		len=1;
		sgn=1;
		a[1]=1;
		return;
	}
	if(sgn==1){
		a[1]++;
		a[2]+=a[1]/M;
		a[1]%=M;
		int p=1;
		while(a[p+1]){
		p++;
		a[p+1]+=a[p]/M;
		a[p]%=M;
		}
		len=max(len,p);
	}
	if(sgn==-1){
		a[1]--;
		for(int i=1;i<=len;i++){
			if(a[i]<0){
				a[i+1]--;
				a[i]+=M;
			}
			else break;
		}
		if(a[len]==0)len--;
		if(len==0)sgn=0;
	}
}
int n;
long long AA[262144],BB[262144],C[262144],E[262144];
const char e[50010]="";
//
const int g=3,MOD=998244353;
int N,Rev[262144];
long long qpow(long long a,long long b){
	long long ans=1,tmp=a,bb=1;
	while(bb<=b){
		if(bb&b)ans=ans*tmp%MOD;
		tmp=tmp*tmp%MOD;
		bb<<=1;
	}
	return ans;
}
void ntt(long long *a,int flag){
	for(int i=0;i<N;i++)
	if(i>Rev[i])swap(a[i],a[Rev[i]]);
	for(int i=1;i<N;i<<=1){
		long long wn=flag==1?qpow(g,(MOD-1)/(2*i)):qpow(g,(MOD-1)-(MOD-1)/(2*i));
		
		for(int j=0;j<N;j+=2*i){
			long long w=1;
		for(int k=0;k<i;k++){
			long long x=a[j+k],y=w*a[j+k+i]%MOD;
			a[j+k]=(x+y)%MOD;
			a[j+k+i]=(x-y+MOD)%MOD;
			w=w*wn%MOD;
			}
		}
	}
	if(flag==-1){
		long long ny=qpow(N,MOD-2);
		for(int i=0;i<N;i++)
		a[i]=a[i]*ny%MOD;
	}
}
//
int main(){
	freopen("homework.in","r",stdin);
	freopen("homework.out","w",stdout);
	scanf("%d",&n);
	if(n>=6666){
		printf("0.0001\n");
		return 0;
	}
	sgna=1;lena=1;A[1]=1;
	sgnb=-1;lenb=1;B[1]=1;
	for(int i=1;i<=n;i++){
		mul(A,lena,sgna,-i);
		inc(A,lena,sgna);
		mul(B,lenb,sgnb,-i);
	}
	for(int i=lena;i>=1;i--){
	AA[50000+4*(i-1)]=A[i]%10;
	AA[50000+4*(i-1)+1]=A[i]/10%10;
	AA[50000+4*(i-1)+2]=A[i]/100%10;
	AA[50000+4*(i-1)+3]=A[i]/1000%10;
	}
	for(int i=lenb;i>=1;i--){
	BB[4*(i-1)]=B[i]%10;
	BB[4*(i-1)+1]=B[i]/10%10;
	BB[4*(i-1)+2]=B[i]/100%10;
	BB[4*(i-1)+3]=B[i]/1000%10;
	}
	for(int i=0;i<50000;i++)
	E[i]=e[49999-i]-'0';
	N=131072;
	for(int i=0;i<N;i++){
		int x=i,y=0;
		for(int j=1;j<N;j<<=1){
		y=(y<<1)|(x&1);
		x>>=1;
		}
		Rev[i]=y;
	}
	ntt(BB,1);
	ntt(E,1);
	for(int i=0;i<N;i++)
	C[i]=BB[i]*E[i]%MOD;
	ntt(C,-1);
	for(int i=0;i<N-1;i++){
		C[i+1]+=C[i]/10;
		C[i]%=10;
	}
	int tag=0;
	for(int i=N+49999;i>=0;i--){
	if(AA[i]>C[i])break;
	if(AA[i]<C[i]){tag=1;break;}
	}
	if(tag){
		for(int i=0;i<N+50000;i++)
		swap(AA[i],C[i]);
	}
	int j=0;
	for(int i=0;i<N+50000;i++){
	int jj=j;
	j=(AA[i]-C[i]-jj<0?1:0);
	AA[i]=(AA[i]-C[i]-jj+10)%10;
	}
	if((tag==1&&sgnb==-1)||(tag==0&&sgnb==1))printf("-");
	if(AA[49995]>=5){
		AA[49996]++;
		for(int i=49996;AA[i]>9;i++){
			AA[i+1]++;
			AA[i]%=10;
		}
	}
	bool flag=0;
	for(int i=N+49999;i>=50000;i--){
	if(AA[i]||i==50000)flag=1;
	if(flag)printf("%lld",AA[i]);
	}
	printf(".");
	for(int i=49999;i>=49996;i--)
	printf("%lld",AA[i]);
	return 0;
}
